import { Button, Modal } from 'antd';

export default function Edit(props) {
    const [isModalOpen, setIsModalOpen] = useState(false);
    console.log(props.isOpened);
    const showModal = () => {
        setIsModalOpen(true);
    };
    const handleOk = () => {
        setIsModalOpen(false);
    };
    const handleCancel = () => {
        setIsModalOpen(false);
    };
    return (
        <>
        <Button onClick={showModal}></Button>
            <Modal title="Basic Modal" open={props.Opened} onOk={handleOk} onCancel={handleCancel}>
                <p>Some contents...</p>
                <p>Some contents...</p>
                <p>Some contents...</p>
            </Modal>
        </>
    );
};
